import homePage from './components/homePage';

import { BrowserRouter, Route,Switch} from 'react-router-dom';

import  './App.css';

function App() {
  render(); {
    <BrowserRouter>
    <Switch>
      <Route exact={true} path="/" component={homePage} />

    </Switch>
</BrowserRouter>
}
}

export default App;
